INSERT INTO `kongfz` VALUES ('53', '【已故著名美籍华裔女作家、历史学家、正义的天使 张纯如（Iris Chang）中英文双签名本】《南京暴行——被遗忘的大屠杀》1998年一版一印 不能忘却的历史！绝版！珍贵！', '八五品', '1200.00', 'rocben的书摊（3星）', '今日上书', 'http://www.kfzimg.com/sw/kfzimg/597/73dacc4eaf9e7c09_b.jpg', 'http://www.kfzimg.com/sw/kfzimg/597/73dacc4eaf9e7c09_b.jpg', 'http://www.kfzimg.com/sw/kfzimg/596/73dacb9a726a6389_b.jpg', 'http://www.kfzimg.com/sw/kfzimg/596/73dacb9a726a6389_b.jpg', 'http://www.kfzimg.com/sw/kfzimg/596/73dacdcac9b0eac4_b.jpg', '广东深圳罗湖', '1', '张纯如', '张纯如', '', NULL, NULL, '平装', '32开', '238页', '2019-11-26', '\r\n                    陈旧泛黄       ', '张纯如（Iris Chang，1968年3月28日－2004年11月9日），美国华裔女作家、历史学家，祖籍江苏淮安。张纯如是出生在新泽西的第二代美国华裔。\r\n张纯如的引人注目之处在于，她擅用新颖独特的手法描述华人在中国和美国的生活，揭示鲜为人知的中国历史和美国华人史的重要史料，\r\n其《钱学森传》、《南京大屠杀》、《华人在美国》等作品。', '1998-04', '东方出版社', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `kongfz` VALUES ('54', '清末外交家、光华大学创办人之一、光华校董会首任董事长 王省三（王丰镐，1858-1933）约宣统时毛笔手稿《法学通论讲述 · 卷三》线装一册共三十叶六十面（使用“贵胄法政学堂“专用稿纸，书法极漂亮）珍贵收藏 包顺丰 S023', '八五品', '32000.00', '小舟书店（特色3钻）', '今日上书', 'http://www.kfzimg.com/sw/kfzimg/179/1eda29ce9958e834_b.jpg', 'http://www.kfzimg.com/sw/kfzimg/178/1eda2942b031ae11_b.jpg', 'http://www.kfzimg.com/sw/kfzimg/178/1eda2b2282c5feb3_b.jpg', 'http://www.kfzimg.com/sw/kfzimg/179/1eda2beae0beb4eb_b.jpg', 'http://www.kfzimg.com/sw/kfzimg/180/1eda2c8afda6bf40_b.jpg', '河南南阳淅川', '1', '王省三', NULL, '宣统 (1909-1911)', NULL, NULL, NULL, '23.5 × 14.3 cm', '60页', '2019-12-02', '\r\n                    此册很可能是王省三为贵胄法政学堂编写的讲义，原出自中国书店，曾由沈氏甲乙堂收藏，首页钤印章两枚。其中一个筒子叶漏写，猜测原因是原本两叶叠在一起，空白叶被折在里面，内容完整不缺（“故各国法令通用”下接“用于驻在外国之……”）《王省三先生暨费佩翠夫人昭德之碑》不仅颂扬了王省三先生捐地办学的爱国义举，而且见证了华东师大前身光华大学创办的历史过程，因此无疑是可遇不可求的珍贵校史文物。\r\n                ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `kongfz` VALUES ('55', '周退密信札（五）没信封', '九品', '3600.00', '悦友文斋（5星）', '今日上书', 'http://www.kfzimg.com/sw/kfzimg/597/73d33d26dd623534_MASK_b.jpg', 'http://www.kfzimg.com/sw/kfzimg/596/73d33ceaa751f94b_MASK_b.jpg', 'http://www.kfzimg.com/sw/kfzimg/596/73d33cfe89c5df3b_MASK_b.jpg', 'http://www.kfzimg.com/sw/kfzimg/596/73d33cfe89c5df3b_MASK_b.jpg', 'http://www.kfzimg.com/sw/kfzimg/595/73d33eb623e74a48_MASK_b.jpg', '上海宝山', '1', '周退密', NULL, '90年代 (1990-1999)', NULL, NULL, NULL, '26 × 17 cm', '1页', '2019-12-02', '\r\n                    周退密，原名昌枢，1914年生于浙江宁波。毕业于上海震旦大学，早年曾任上海法商学院、大同大学教授，后在哈尔滨外国语学院、上海外国语学院长期从事外语教学工作,参与《法汉辞典》的编写工作。著名的收藏家、学者、书法家、诗人、文史专家，上海文史馆员、上海诗词协会顾问。号石窗，室名红豆宦，四明名宿，工诗词、擅翰墨，精碑帖，富收藏，大凡传统文人的雅嗜，他皆有造诣，郑逸梅先生曾称之为“海上寓公”。\r\n                ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
